"use strict";(self.webpackChunkvuepress_notes=self.webpackChunkvuepress_notes||[]).push([[170],{628:(e,i)=>{i.A=(e,i)=>{const o=e.__vccOpts||e;for(const[e,r]of i)o[e]=r;return o}},6364:(e,i,o)=>{o.r(i),o.d(i,{comp:()=>n,data:()=>l});var r=o(8178);const a={},n=(0,o(628).A)(a,[["render",function(e,i){return(0,r.uX)(),(0,r.CE)("div",null,i[0]||(i[0]=[(0,r.Fv)('<h1 id="软件-网盘-onedrive-windows" tabindex="-1"><a class="header-anchor" href="#软件-网盘-onedrive-windows"><span>软件-网盘-OneDrive-Windows</span></a></h1><h2 id="proxifier-设置代理端口" tabindex="-1"><a class="header-anchor" href="#proxifier-设置代理端口"><span>Proxifier 设置代理端口</span></a></h2><ol><li><p>用管理员身份运行软件</p><ul><li>注意：第一次启动使用管理员身份，如果想要开机启动，后面需要取消勾选管理员身份运行</li></ul></li><li><p>输入注册码，最好是勾选 <code>All userss on this computer(require administrator)</code></p><ul><li>免安装版本：<code>L6Z8A-XY2J4-BTZ3P-ZZ7DF-A2Q9C</code></li><li>安装版本：<code>5EZ8G-C3WL5-B56YG-SCXM9-6QZAP</code></li><li>Mac 版本：<code>P427L-9Y552-5433E-8DSR3-58Z68</code></li></ul></li><li><p><code>Profile</code>-&gt;<code>Proxy Servers</code>，添加 HTTPS 和 Socks5 代理配置</p><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20240722124500.png" alt="20240722124500"></li><li><p><code>Profile</code>-&gt;<code>Proxification Rules</code>，配置软件代理规则</p><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20240722124716.png" alt="20240722124716"><p>其中，点击 <code>Browse</code>，并找到 <code>onedrive.exe</code> 执行文件：</p><ul><li>WIN10：<code>C:\\Program Files\\Microsoft OneDrive\\</code> 文件夹下</li><li>WIN11：<code>%localappdata%\\Microsoft\\OneDrive\\</code> 文件夹下（与 WIN10 通用）</li></ul></li><li><p>把 <code>default</code> 的 <code>action</code> 设置为 <code>direct</code>（所有程序不全都通过代理）</p></li></ol><p>下载地址：<a href="https://www.proxifier.com/download/" target="_blank" rel="noopener noreferrer">https://www.proxifier.com/download/</a></p><details><summary>问题：proxifier 和 chrome 不能共存</summary><p>解决办法：安装 proxifier 的安装版，不使用便携版</p></details><h2 id="开启多线程" tabindex="-1"><a class="header-anchor" href="#开启多线程"><span>开启多线程</span></a></h2><ol><li><p>进入以下文件：<code>C:\\Users\\用户名\\AppData\\Local\\Microsoft\\OneDrive\\settings\\Personal\\global.ini</code></p><p>或者直接地址栏输入：<code>%localappdata%\\Microsoft\\OneDrive\\settings\\Personal\\global.ini</code></p></li><li><p>在打开的文件的第一行添加以下代码</p><div class="language-txt line-numbers-mode" data-highlighter="shiki" data-ext="txt" style="--shiki-light:#383A42;--shiki-dark:#abb2bf;--shiki-light-bg:#FAFAFA;--shiki-dark-bg:#282c34;"><pre class="shiki shiki-themes one-light one-dark-pro vp-code"><code class="language-txt"><span class="line"><span>numberOfConcurrentUploads=3</span></span></code></pre><div class="line-numbers" aria-hidden="true" style="counter-reset:line-number 0;"><div class="line-number"></div></div></div><p>数值项即为线程数，最小值为 1，最大值为 3</p></li></ol><h2 id="参考" tabindex="-1"><a class="header-anchor" href="#参考"><span>参考</span></a></h2><ul><li>整体：<a href="https://blog.tcpsoft.app/2020/03/let-onedrive-fly-scientifically/" target="_blank" rel="noopener noreferrer">科学地让 OneDrive 飞，下载速度 5Mb/s</a></li><li><code>Proxifier 注册码</code>：<a href="https://blog.csdn.net/weixin_43845335/article/details/88396826" target="_blank" rel="noopener noreferrer">Proxifier 注册码序列号_proxifier 序列号</a></li></ul>',9)]))}]]),l=JSON.parse('{"path":"/SecondBrain/100-%E6%89%8B%E5%86%8C/103-%E8%BD%AF%E4%BB%B6%E4%BD%BF%E7%94%A8%E6%89%8B%E5%86%8C/%E8%BD%AF%E4%BB%B6-%E7%BD%91%E7%9B%98-OneDrive-Windows.html","title":"软件-网盘-OneDrive-Windows","lang":"zh-CN","frontmatter":{},"git":{},"readingTime":{"minutes":1.17,"words":352},"filePathRelative":"SecondBrain/100-手册/103-软件使用手册/软件-网盘-OneDrive-Windows.md"}')}}]);